import React from "react";
import ReactDOM from "react-dom";

//const element = <h1>Hello!</h1>;

class Kompo extends React.Component {
  constructor() {
    super();
    this.state = {
      text: ""
    };
  }

  klikki(text) {
    this.setState({ text: text });
  }
  render() {
    const style = {
      background: "red",
      fontSize: "5px",
      marginTop: "0px"
    };
    return (
      <div center style={{ background: "white", msWrapMargin: "40px" }}>
        <button
          onClick={e => {
            this.klikki("testi");
          }}
        >
          <img src="https://i.warosu.org/data/fa/img/0106/19/1448220270209.png" />
        </button>
        <div>
          <h1 style={{ background: "blue", color: "white", fontSize: "100px" }}>
            tää on mun teksti :D
            <div style={style}>ha gayyy</div>
          </h1>
        </div>
      </div>
    );
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
